-- ----------------------------
-- procedure structure for CheckIfUserLocked
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[sanna].[CheckIfUserLocked]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[sanna].[CheckIfUserLocked]
GO

CREATE PROCEDURE [sanna].[CheckIfUserLocked]  
   @login_email nvarchar(1500),
   @is_locked smallint  OUTPUT
AS 
   BEGIN

      SET  XACT_ABORT  ON

      SET  NOCOUNT  ON

      SET @is_locked = NULL

      DECLARE
         @last_locked datetime = NULL

      DECLARE
         @minutes_diff int = NULL

      DECLARE
         @attempts int

      SET @is_locked = 0

      SELECT @last_locked = users.date_locked
      FROM sanna.users
      WHERE users.email = @login_email AND users.state <> 0

      IF @last_locked IS NOT NULL
         /*
         *   SSMA warning messages:
         *   M2SS0280: DATEDIFF function conversion with minute as parameter may result in datetime overflow error.
         */

         SELECT @minutes_diff = datediff(minute, @last_locked, getdate())

      SELECT @attempts = users.login_attempts
      FROM sanna.users
      WHERE users.email = @login_email AND users.state <> 0

      IF 
         @attempts >= 3 AND 
         @minutes_diff IS NOT NULL AND 
         @minutes_diff <= 15
         SET @is_locked = 1
      ELSE 
         BEGIN
            IF 
               @attempts >= 3 AND 
               @minutes_diff IS NOT NULL AND 
               @minutes_diff > 15
               BEGIN

                  UPDATE sanna.users
                     SET 
                        login_attempts = 0
                  WHERE users.email = @login_email AND users.state <> 0

                  SET @is_locked = 0

               END
         END

      SELECT @is_locked

   END
GO


-- ----------------------------
-- procedure structure for IncrementLoginAttempts
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[sanna].[IncrementLoginAttempts]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[sanna].[IncrementLoginAttempts]
GO

CREATE PROCEDURE [sanna].[IncrementLoginAttempts]  
   @login_email nvarchar(1500)
AS 
   BEGIN

      SET  XACT_ABORT  ON

      SET  NOCOUNT  ON

      DECLARE
         @current_attempts int

      SELECT @current_attempts = users.login_attempts
      FROM sanna.users
      WHERE users.email = @login_email

      IF @current_attempts < 3
         BEGIN

            UPDATE sanna.users
               SET 
                  login_attempts = users.login_attempts + 1
            WHERE users.email = @login_email

            SELECT @current_attempts = users.login_attempts
            FROM sanna.users
            WHERE users.email = @login_email

            IF @current_attempts >= 3
               UPDATE sanna.users
                  SET 
                     date_locked = getdate()
               WHERE users.email = @login_email

         END

   END
GO


