-- ----------------------------
-- procedure structure for UpdateCampusCondition
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[sanna].[UpdateCampusCondition]') AND type IN ('P', 'PC', 'RF', 'X'))
	DROP PROCEDURE[sanna].[UpdateCampusCondition]
GO

CREATE PROCEDURE [sanna].[UpdateCampusCondition]
AS 
   BEGIN

      SET  XACT_ABORT  ON

      SET  NOCOUNT  ON

      UPDATE ca
         SET 
            condition_id = 
               CASE 
                  WHEN mcd.day = CAST(getdate() AS DATE) THEN 1
                  ELSE 3
               END
      FROM 
         sanna.campus  AS ca 
            LEFT JOIN sanna.medical_calendars  AS mc 
            ON ca.id = mc.campus_id 
            LEFT JOIN sanna.medical_calendar_days  AS mcd 
            ON mc.id = mcd.medical_calendar_id

   END
GO


